def main(s: str, k: int) -> int:
    count = 0
    ans = 0
    vowels = set('aeiou')
    for i in range(len(s)- k + 1):
        # print(s[i:i+k])
        for j in s[i:i+k]:
            if j in vowels:
                count += 1
        ans = max(ans, count)
        count = 0
    return ans




if __name__ == '__main__':
    print(main("abciiidef", 3))
    print(main("aeiou", 2))
    print(main("leetcode", 3))
    print(main("rhythms", 4))
    print(main("tryhard", 4))
    print(main("", 50436  ))
